    false,nt"url": null,nt"notes": "This narrative report for Lake Andes NWR
    outlines Refuge accomplishments from January through April of 1960. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, furbearers, predators, rodents, mammals, raptors, fish, and disease- is also
    covered. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes Refuge visitors and
    Refuge participation. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
